import "./Styles.css";

const Results = (props) => {
  let currentDate = new Date();
  let newDate;
  let week = [];
  for (var i = 0; i <= 6; i++) {
    newDate = new Date(
      currentDate.getFullYear(),
      currentDate.getMonth(),
      currentDate.getDate() + i
    );

    week.push({date:newDate.toDateString(),id:i});
  }
  console.log(week)
  return (
    <div>
      <h2>Results</h2>
      <table>
        <thead>
          <tr>
            <th>Center Name</th>
            {week.map((day) => (
              <th key={day.id}>{day.date}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {props.data.map((centerinfo) => (
            <tr key={centerinfo.center_id}>
              <td>{centerinfo.name}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Results;
